import React from "react";
import {Link} from "react-router-dom";

function Home (){

    return(
        <div>
            <h1>Welcome!</h1>
            <h1>This is 24!!!!</h1>
            <p>24 is a card game</p>
            <p>24 is an arithmetical puzzle in which the objective is to find a way to manipulate four integers so that the end result is 24</p>
            <br/>
            <Link to="/game">PLAY</Link>
        </div>
    )
}

export default Home
